def decode_string(s: str) -> str:
    num_stack, str_stack = [], ['']
    num = ''
    for c in s:
        if c.isdigit():
            num += c
        elif c == '[':
            num_stack.append(int(num))
            num = ''
            str_stack.append('')
        elif c == ']':
            str_stack[-2] += str_stack.pop() * num_stack.pop()
        else:
            str_stack[-1] += c
    return str_stack[0]
